import React from "react";
import { Grid, Paper, TextField, Button, Typography } from "@material-ui/core";
import { Link } from "react-router-dom";

const Signup = () => {
  const paperStyle = { padding: 50, width: 300, margin: "150px auto" };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add your login logic here
  };

  return (
    <Grid container ="center" style={{ backgroundColor: "pink", height: "100vh" }}>
      <Paper elevation={10} style={paperStyle}>
        <form onSubmit={handleSubmit}>
          <Typography variant="h5">Login</Typography>
          <TextField label="Username" placeholder="Enter Username" fullWidth required margin="normal" />
          <TextField label="Email" placeholder="Enter Email" fullWidth required margin="normal" />
          <TextField
            label="Password"
            placeholder="Enter Password"
            type="password"
            fullWidth
            required
            margin="normal"
          />
          <TextField
            label="Confirm Password"
            placeholder="Confirm Password"
            type="password"
            fullWidth
            required
            margin="normal"
          />
          <Button type="submit" variant="contained" color="primary" fullWidth>
            Signup
          </Button>
        </form>
        
      </Paper>
    </Grid>
  );
};

export default Signup;
